import React from "react";
import ReactDOM from "react-dom";
import './index.css';

const currDate = new Date().toLocaleDateString();
const currTime = new Date().toLocaleTimeString();

const image1 = "https://picsum.photos/200/300";
const image2 = "https://picsum.photos/202/300";
const image3 = "https://picsum.photos/204/300";

ReactDOM.render(
  <>

      <h1 contentEditable="true">Ambarish Bhagawati</h1>
      <p>Current Date : {currDate}</p>
      <p>Current Time : {currTime}</p>
      <div className="div1">
      <img src={image1} alt="image1" />
      <img src={image2} alt="image2" />
      <img src={image3} alt="image3" />
    </div>
  </>,
  document.getElementById("root")
);
